import React from 'react';
import { motion } from 'framer-motion';
import { MapPin, Link, Star, TrendingUp, FileText, Shield, Target, Zap } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const Services = () => {
  const navigate = useNavigate();

  const serviceRoutes = {
    'Google Business Profile Optimization': '/services/google-business-profile',
    'Strategic Map Embed Stacking': '/services/map-embed-stacking',
    'Review Generation & Management': '/services/review-management',
    'Local Citation Building': '/services/local-citation-building',
    'Monthly Performance Reporting': '/services/performance-reporting'
  };

  const handleLearnMore = (serviceTitle) => {
    const route = serviceRoutes[serviceTitle];
    if (route) {
      navigate(route);
    }
  };

  const services = [
    {
      icon: MapPin,
      title: 'Google Business Profile Optimization',
      description: 'Complete setup and optimization of your Google Business Profile for maximum local visibility and search ranking.',
      benefits: [
        'Professional profile completion and optimization',
        'Category and keyword optimization',
        'Photo and media optimization',
        'Hours, services, and attributes setup',
        'Review management and response strategies'
      ],
      results: 'Most clients see 40-60% improvement in local search visibility'
    },
    {
      icon: Link,
      title: 'Strategic Map Embed Stacking',
      description: 'Advanced placement of Google Maps embeds across high-authority websites to build local search signals and authority.',
      benefits: [
        'White-hat embedding on high DA websites',
        'Tiered approach for natural link building',
        'IP-diverse strategy for safety',
        'Authority building across multiple domains',
        'Geographic targeting for local relevance'
      ],
      results: 'Typically generates 200-400% increase in local ranking signals'
    },
    {
      icon: Star,
      title: 'Review Generation & Management',
      description: 'Proven systems to generate authentic, positive reviews while managing your online reputation effectively.',
      benefits: [
        'Automated review request systems',
        'Review monitoring and alerts',
        'Professional response management',
        'Review optimization for SEO',
        'Reputation crisis management'
      ],
      results: 'Average 3-5 new reviews per month with 4.5+ star ratings'
    },
    {
      icon: TrendingUp,
      title: 'Local Citation Building',
      description: 'Comprehensive local citation building and high-quality backlink acquisition to strengthen your domain authority.',
      benefits: [
        'NAP consistency across all platforms',
        'Industry-specific citation building',
        'High DA backlink acquisition',
        'Local business directory submissions',
        'Citation cleanup and monitoring'
      ],
      results: 'Builds 50-100 quality citations per month'
    },
    {
      icon: FileText,
      title: 'Monthly Performance Reporting',
      description: 'Comprehensive monthly reports showing your progress, local ranking improvements, and actionable insights.',
      benefits: [
        'Detailed ranking tracking and analysis',
        'Call volume and lead generation metrics',
        'Competitor monitoring and analysis',
        'Performance insights and recommendations',
        'ROI tracking and reporting'
      ],
      results: 'Clear visibility into your local SEO performance and ROI'
    }
  ];

  return (
    <section className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            Our Local SEO Services
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Comprehensive local SEO strategies designed to dominate Google Maps and drive real business growth through proven techniques and measurable results.
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 max-w-7xl mx-auto mb-16">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
              className="bg-white rounded-2xl p-8 shadow-lg hover:shadow-xl transition-all duration-300 border border-gray-100"
            >
              {/* Icon */}
              <div className="w-16 h-16 bg-gradient-to-br from-primary-500 to-primary-600 rounded-2xl flex items-center justify-center mb-6">
                <service.icon className="w-8 h-8 text-white" />
              </div>

              {/* Title */}
              <h3 className="text-2xl font-bold text-primary-900 mb-4">
                {service.title}
              </h3>

              {/* Description */}
              <p className="text-gray-600 mb-6 leading-relaxed">
                {service.description}
              </p>

              {/* Benefits */}
              <div className="mb-6">
                <h4 className="font-semibold text-primary-900 mb-3 flex items-center gap-2">
                  <Shield className="w-4 h-4" />
                  What You Get
                </h4>
                <ul className="space-y-2">
                  {service.benefits.map((benefit, benefitIndex) => (
                    <li key={benefitIndex} className="flex items-start gap-3 text-gray-700">
                      <div className="w-2 h-2 bg-orange-500 rounded-full mt-2 flex-shrink-0"></div>
                      <span className="text-sm">{benefit}</span>
                    </li>
                  ))}
                </ul>
              </div>

              {/* Results */}
              <div className="bg-gradient-to-r from-green-50 to-blue-50 rounded-xl p-4 border border-green-100">
                <div className="flex items-center gap-2 mb-2">
                  <Target className="w-4 h-4 text-green-600" />
                  <span className="font-semibold text-green-900 text-sm">Expected Results</span>
                </div>
                <p className="text-green-800 text-sm">{service.results}</p>
              </div>

              {/* Learn More Button */}
              <div className="mt-6">
                <button 
                  onClick={() => handleLearnMore(service.title)}
                  className="w-full bg-[#3b82f6] hover:bg-[#2563eb] text-white font-medium py-3 px-6 rounded-xl transition-all duration-300 transform hover:scale-105 focus:outline-none focus:ring-2 focus:ring-[#3b82f6] focus:ring-offset-2"
                >
                  Learn More
                </button>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Why Choose Us Section */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="max-w-4xl mx-auto mb-16"
        >
          <div className="bg-white rounded-2xl p-8 shadow-lg border border-gray-100">
            <h3 className="text-2xl font-bold text-primary-900 text-center mb-8">
              Why Choose Rankly360 for Local SEO?
            </h3>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
